import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './pages/Home';
import ListaClientes from './components/cliente/ListaClientes';
import FormularioCliente from './components/cliente/FormularioCliente';
import DetalhesCliente from './components/cliente/DetalhesCliente';
import EditarCliente from './components/cliente/EditarCliente';
import TodosOrcamentos from './components/orcamento/TodosOrcamentos';
import CriarOrcamento from './components/orcamento/CriarOrcamento';
import OrcamentosCliente from './components/OrcamentosCliente';
import DetalhesOrcamento from './components/orcamento/DetalhesOrcamento';

function App() {
  return (
    <Router>
      <Routes>
        {/* Rota inicial apontando para Home */}
        <Route path="/" element={<Home />} />

        {/* Rotas para clientes */}
        <Route path="/clientes" element={<ListaClientes />} />
        <Route path="/adicionar" element={<FormularioCliente />} />
        <Route path="/detalhes/:id" element={<DetalhesCliente />} />
        <Route path="/editar/:id" element={<EditarCliente />} />

        {/* Rotas para or√ßamentos */}
        <Route path="/orcamentos" element={<TodosOrcamentos />} />
        <Route path="/criar-orcamento" element={<CriarOrcamento />} />
        <Route path="/clientes/:id/orcamentos" element={<OrcamentosCliente />} />
        <Route path="/detalhes-orcamento/:id" element={<DetalhesOrcamento />} />
      </Routes>
    </Router>
  );
}

export default App;
